def is_rotationally_symmetrical(n, m, segments):

    def check(k, g):
        for i in g:
            a = (i[0] + k) % n
            b = (i[1] + k) % n
            if not (min(a, b), max(a, b)) in g:
                return False
        return True
    g = set()
    for (a, b) in segments:
        a += 1
        b -= 1
        g.add((min(a, b), max(a, b)))
    for i in range(1, n):
        if n % i == 0:
            if check(i, g):
                return True
    return False

